const defaultState = {
    last: null,
    now: null
}

const reducer = (state = defaultState, action) => {
    console.log(state, action);
    switch (action.type) {
        case 'INC':
            return {
                last: 'xd',
                now: action.payload
            };
        default:
            return state;
    }
}

export default reducer;
